import * as React from 'react';
import { Button, View, Text, StatusBar, StyleSheet} from 'react-native';

export default class SchedulingTimesUpScreen extends React.Component {
	render(){
		return(
            <View style={styles.Times_Up}>
                <StatusBar barStyle="dark-content" backgroundColor="#ecf0f1" />
                <Text>Times Up </Text>
 
                <Button
                    title="Return to Main Function page"
                    onPress={() => this.props.navigation.navigate("MainFunction")}
                />
            </View>
		)
	}
}

const styles = StyleSheet.create({
    Times_Up: {
        backgroundColor: '#90FF33', 
        flex: 1, 
        alignItems: 'center', 
        justifyContent: 'center' 
    }
});
